import React from 'react'
import './Confirmation.css'
import Footer from '../Components/Footer'
import Header from '../Components/Header'
import witches from '../images/witches.png'


const Confirmation = () => {
  const [movieDetails, setMovieDetails] = useState(null);
  const { movieId } = useParams();
  const [selectedMovie, setSelectedMovie] = useState(null);

  useEffect(() => {
    const fetchMovieDetails = async () => {
      try {
        const response = await fetch(`https://api.themoviedb.org/3/movie/${movieId}?api_key=f211287ee7b15b080bb278734cd356db`);
        if (!response.ok) {
          throw new Error(`Failed to fetch movie details (HTTP status: ${response.status})`);
        }
        const data = await response.json();
        setMovieDetails(data);
      } catch (error) {
        console.error('Error fetching movie details:', error.message);
      }
    };

    fetchMovieDetails();
  }, [movieId]);

  const handleClick = () => {
    setSelectedMovie(movieId);
    window.location.href = `/confirmation/${movieId}`;
  };





  return (
    <div className='confirmation'>
      <Header />
      <link
          rel='stylesheet'
          href='https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta2/css/all.min.css'
          integrity='sha512-YWzhKL2whUzgiheMoBFwW8CKV4qpHQAEuvilg9FAn5VJUDwKZZxkJNuGM4XkWuk94WCrrwslk8yWNGmY1EduTA=='
          crossOrigin='anonymous'
          referrerPolicy='no-referrer'
        />
        <script
          src='https://kit.fontawesome.com/2d95ff6af1.js'
          crossOrigin='anonymous'
        ></script>
        <div className="cover">

        </div>
      <div className="info">
        <div className="title">
        <h2>OC Brazil</h2>
        <i class="fa-regular fa-clock"></i>
        <span>1HR 45MIN</span>
        </div>
        <div className="des">The film centres on Sam Lowry, a low-ranking bureaucrat trying to find a woman who appears in his dreams
while he is working in a mind-numbing job and living in a small apartment, set in a dystopian world
in which there is an over-reliance on poorly maintained (and rather whimsical) machines.</div>
      </div>
    
      <div className="progress-bar">
        
        <div className="left">
          <span>1</span>
          <p>Select Movie</p>
        </div>
        
        <div className="mid">
          <span>2</span>
          <p>Confirmation</p>
        </div>
        
        <div className="right">
          <span>3</span>
          <p>Reserve / Buy</p>
        </div>
      </div>
      <div className="movie-info">
        <div className="movie-cover">
          <img src={witches} alt="" />
        </div>
        <div className="movie-info-title">
          OC Brazil - Part2
          <div className="genre">
          <i class="fa-solid fa-film"></i>
          <span>Fantasy / Sci-fi</span>
          </div>
          <span>IMAX 2D</span>
          <div className="time-seat">
          <div className="time">
            <span>20:00</span>
          </div>
          <div className="seat">
            <span>4A</span>
          </div>
          </div>
        </div>
      <div className="continue">
        <button>Proceed to check out</button>
      </div>
      </div>
      <Footer />
    </div>
  )
}

export default Confirmation
